                    <h5 class="mb-0 mt-3" style="color: white; font-size: 20px;">
                        {{ model.profile.Email }}
                    </h5>
                    <span class="d-block text-muted">Desbloquear cuenta</span>
                </div>

                <div class="form-group form-group-feedback form-group-feedback-left">
                    <input type="password" class="form-control" placeholder="Password" [(ngModel)]="model.password"
                        (keydown.enter)="authtenticate()">
                    <div class="form-control-feedback">
                        <i class="icon-user-lock text-muted"></i>
                    </div>
                </div>

                <button type="submit" class="btn btn-primary btn-block" (click)="authtenticate()">
                    <i class="icon-unlocked mr-2"></i> Desbloquear
                </button>

                <br>
                <div class="text-center mb-3" *ngIf="!!model.error">
                    <span class="d-block bg-danger">** {{ model.error }}</span>
                </div>

                <br>
                <div class="form-group form-group-feedback form-group-feedback-left text-center">
                    <a href="#/login" class="ml-auto" (click)="close()">Ingresar con otra cuenta</a>
                </div>


            </div>
